import './App.css';
import Navbar from './Components/Navbar';
import ProfilePic from './Assets/profile_crop_2.png';

function App() {
  return (
    <div className="App">
      <Navbar />
      <div className="flex-center-v">
        <div
          className="flex-center-h orange"
          style={{
            fontSize: '3em',
          }}
        >
          <strong>E Komo Mai</strong>
        </div>
        <div
          className="flex-center-h orange"
          style={{
            fontSize: '2em',
          }}
        >
          (Welcome)
        </div>
        <div className="profile flex-center-h">
          <img className="profpic" src={`${ProfilePic}`} height="500px" />
          <div className="circle"></div>
        </div>
        <div
          className="flex-center-h dark-blue light-bkgd"
          style={{ minWidth: '100%', zIndex: 2 }}
        >
          <p style={{ textAlign: 'center', maxWidth: '90%' }}>
            Aloha. My name is Derek Joshua Bal. I am a{' '}
            <strong className="dark-orange" style={{ fontSize: '1.2em' }}>
              Full-Stack Web Developer.
            </strong>
            <hr></hr>I am currently a Maui-based Preschool Teacher Aide with a
            Bachelors of Arts in Anthropology.<br></br>
            <br></br>Post-college, I have taken a fascination with coding and
            its endless possibilities to inspire.
          </p>
        </div>
      </div>
    </div>
  );
}

export default App;
